('5764c9812b0bc', 'profile_update_email_sent', 'Update profile', 'Update profile', '	<!-- Page container -->\r\n	<div class="page-container login-container" style="min-height:249px">\r\n\r\n		<!-- Page content -->\r\n		<div class="page-content">\r\n\r\n			<!-- Main content -->\r\n			<div class="content-wrapper">\r\n				<div class="row">\r\n					<div class="col-sm-2 col-md-3">\r\n						\r\n					</div>\r\n					<div class="col-sm-8 col-md-6">\r\n\r\n                    <!-- form -->\r\n				                  \r\n					<h2 class="text-semibold mt-40 text-white">{LIST_NAME}</h2>\r\n                        <div class="panel panel-body">						\r\n<h4>Email sent</h4>          \r\n<hr />\r\n                        <p>For security, we\'ve sent an email to your inbox that contains a link to update your preferences.</p></div>\r\n\r\n                    <!-- /form -->\r\n    \r\n						\r\n					</div>\r\n				</div>\r\n			</div>\r\n			<!-- /main content -->\r\n\r\n		</div>\r\n		<!-- /page content -->\r\n\r\n\r\n		<!-- Footer -->\r\n		<div class="footer text-white">\r\n			<span class="text-white">Copyright &copy; 2021. All rights reserved.</a>			\r\n		</div>\r\n		<!-- /footer -->\r\n\r\n	</div>\r\n	<!-- /page container -->', 'page', '2016-06-19 21:59:11', '2016-06-19 22:09:37'),
